import { useEffect } from "react"
import { useState } from "react"

export const EditProfile = ({ user }) => {

    const [profile, setProfile] = useState({})

    useEffect(() => {
        setProfile(user)
    }, [user])

    return (
        <>edit profile</>
    )
}
